import ADD_NUMBER from '/home/dipaferdian/reactweb/src/redux_actions/actions'

export const count = (state = 0, action) => {
  switch (action.type) {
    case ADD_NUMBER:
      return state + action.payload;
    default:
      return state;
  }
};
